DECLARE
  
  CURSOR cr_crapttl(pr_nrdconta IN CECRED.crapttl.NRDCONTA%TYPE
                   ,pr_nrcpfcgc IN CECRED.crapttl.NRCPFCGC%TYPE) IS
    SELECT t.vlsalari
      , t.tpdrendi##1
      , t.vldrendi##1
      , t.tpdrendi##2
      , t.vldrendi##2
      , t.tpdrendi##3
      , t.vldrendi##3
      , t.tpdrendi##4
      , t.vldrendi##4
      , t.dsjusren
      , t.idseqttl
    FROM CECRED.CRAPTTL t
    WHERE t.nrdconta = pr_nrdconta
      AND t.cdcooper = 1
      AND t.nrcpfcgc = pr_nrcpfcgc;

  rw_crapttl cr_crapttl%ROWTYPE;

  CURSOR cr_crapdat IS
    SELECT d.dtmvtolt
    FROM CECRED.crapdat d
    WHERE d.cdcooper = 1;
    
  vr_dtmvtolt CECRED.crapdat.DTMVTOLT%TYPE;
  
  CURSOR cr_crapalt ( pr_cdcooper IN CECRED.crapalt.CDCOOPER%TYPE
                    , pr_nrdconta IN CECRED.crapalt.NRDCONTA%TYPE
                    , pr_dtmvtolt IN CECRED.crapalt.DTALTERA%TYPE ) IS
    SELECT a.dsaltera
    FROM CECRED.crapalt a
    WHERE a.cdcooper = pr_cdcooper
      AND a.nrdconta = pr_nrdconta
      AND a.dtaltera = pr_dtmvtolt;
  
  vr_dsaltera crapalt.dsaltera%TYPE;
  
  TYPE TP_CONTA IS RECORD (
    nrdconta   CECRED.crapass.NRDCONTA%TYPE
    , nrcpfcgc CECRED.crapass.NRCPFCGC%TYPE
    , vldrendi CECRED.crapttl.VLDRENDI##1%TYPE
  );
  vr_conta       TP_CONTA;
  
  TYPE           TP_CONTAS IS ARRAY(5058) OF TP_CONTA;
  vt_contas      TP_CONTAS;
  
  TYPE           TP_ALT IS ARRAY(4) OF VARCHAR2(50);
  vt_msgalt      TP_ALT;
  vr_msgalt      VARCHAR2(150);
  vr_contador    PLS_INTEGER := 0;
  
  vr_nrdrowid    ROWID;
  
  vr_dscritic    VARCHAR2(2000);
  vr_exception   EXCEPTION;
  vr_exception2  EXCEPTION;
  
