    IF cr_crapttl%NOTFOUND THEN
      
      CLOSE cr_crapttl;
      CONTINUE;
      
    END IF;
    
    CLOSE cr_crapttl;
    
    BEGIN
      
      UPDATE CECRED.Crapttl
        SET tpdrendi##1   = 6
            , vldrendi##1 = vt_contas(i).vldrendi
            , tpdrendi##2 = 0
            , vldrendi##2 = 0
