        and nrcpfcgc = vt_contas(i).nrcpfcgc;
      
      IF SQL%ROWCOUNT > 1 THEN
        
        vr_dscritic := 'ERRO - ' || SQL%ROWCOUNT || ' registros atualizados para a conta ' || vt_contas(i).nrdconta || ' referente ao CPF ' || vt_contas(i).nrcpfcgc;
        RAISE vr_exception2;
        
      END IF;
      
    EXCEPTION
      WHEN vr_exception2 THEN
        
        RAISE vr_exception;
      
      WHEN OTHERS THEN
        
        vr_dscritic := 'Erro ao atualizar a conta ' || vt_contas(i).nrdconta || ' referente ao CPF ' || vt_contas(i).nrcpfcgc;
        RAISE vr_exception;
        
    END;
    
    OPEN cr_crapalt(1, vt_contas(i).nrdconta, vr_dtmvtolt);
    FETCH cr_crapalt INTO vr_dsaltera;
    
    IF cr_crapalt%NOTFOUND THEN
      
      BEGIN
          
        INSERT INTO CECRED.crapalt (
          nrdconta
          , dtaltera
          , cdoperad
          , dsaltera
          , tpaltera
          , cdcooper
        ) VALUES (
          vt_contas(i).nrdconta
          , vr_dtmvtolt
          , 1
          , 'salario 1.ttl,tip.ren. 1.ttl,valor ren. 1.ttl,justificativa rend. 1.ttl,'
          , 2
          , 1
        );
          
      EXCEPTION
        WHEN OTHERS THEN
            
          vr_dscritic := 'Erro ao Inserir atualizao cadastral para conta ' || vt_contas(i).nrdconta 
